import React from 'react';
import AddEmployee from './AddEmployee';
import axios from 'axios';
import { useState, useEffect } from 'react';
import Employeedropdown from './Employeedropdown';
import { Link } from 'react-router-dom';
import './Displayemployee.css';
function Displayemployee() {



    const [employee, setEmployee] = useState('');

    useEffect(() => {
        loadEmployee();
    }, []);

    const loadEmployee = async () => {
        await axios.get(`http://localhost:8089/loginemployee/${localStorage.getItem("jwtToken")}`)
            .then(res => {
                console.log(res.data)
                axios.get(`http://localhost:8086/view/${res.data}`)
                    .then(response => {
                        setEmployee(response.data)
                        console.log(response.data);
                    })
            })
            .catch(error => {
                console.log(error);
            });

    };

    return (
        <div>
            <Employeedropdown></Employeedropdown>
            <div className="container ">
                <div className="row">
                    <div className="col-md-8 offset-md-3 border rounded p-4 mt-2 shadow">
                        <h3 className="text-center m-6">{employee.firstName} Details</h3>

                        <div className="card">
                            <div className="card-header">
                                <ul className="list-group list-group-flush">
                                    <div className='row'>
                                        <div className='col-md-4'>
                                        <b>Id:</b>
                                            <li className="list-group-item">
                                                
                                                {employee.employeeId}
                                                
                                            </li>

                                        </div>


                                        <div className='col-md-4'>
                                        <b>FisrtName:</b>
                                            <li className="list-group-item">
                                               
                                                {employee.firstName}
                                            </li>
                                        </div>
                                        <div className='col-md-4'>
                                        <b>LastName</b>
                                            <li className="list-group-item">
                                               
                                                {employee.lastName}
                                            </li>
                                        </div>
                                    </div>
                                    <br></br>
                                    <div className='row'>
                                        <div className='col-md-4'>
                                        <b>Contact Number:</b>
                                            <li className="list-group-item">
                                               
                                                {employee.mobileNumber}
                                                
                                            </li>

                                        </div>


                                        <div className='col-md-4'>
                                        <b>Password:</b>
                                            <li className="list-group-item">
                                                
                                                {employee.password}
                                            </li>
                                        </div>
                                        <div className='col-md-4'>
                                        <b>Role</b>
                                            <li className="list-group-item">
                                                
                                                {employee.role}
                                            </li>
                                        </div>
                                    </div>
                                    <br></br>
                                    <div className='row'>
                                        <div className='col-md-4'>
                                        <b>EmailId:</b>
                                            <li className="list-group-item">
                                               
                                                {employee.emailId}
                                                
                                            </li>

                                        </div>


                                        <div className='col-md-4'>
                                        <b>State:</b>
                                            <li className="list-group-item">
                                                
                                                {employee.state}
                                            </li>
                                        </div>
                                        <div className='col-md-4'>
                                        <b>Country</b>
                                            <li className="list-group-item">
                                                
                                                {employee.country}
                                            </li>
                                        </div>
                                    </div>

                                    <br></br>
                                    <div className='row'>
                                        <div className='col-md-4'>
                                        <b>City:</b>
                                            <li className="list-group-item">
                                               
                                                {employee.city}
                                                
                                            </li>

                                        </div>


                                        <div className='col-md-4'>
                                        <b>State:</b>
                                            <li className="list-group-item">
                                                
                                                {employee.state}
                                            </li>
                                        </div>
                                        <div className='col-md-4'>
                                        <b>Country</b>
                                            <li className="list-group-item">
                                                
                                                {employee.country}
                                            </li>
                                        </div>
                                    </div>

                                </ul>
                            </div>
                        </div>
                        <Link className="btn btn-primary my-2" to={"/"}>
                            Back to Home
                        </Link>
                    </div>
                </div>
            </div>
        </div>

    );
}

export default Displayemployee;
